import React from 'react'

import ForgotPassword from '../../components/ForgotPassword'



const submit = values => {
    window.alert (JSON.stringify (values));
};

const forgotPasswordContainer = () => {
    return (
        <div>
            <ForgotPassword
                onSubmit={submit}
            />
        </div>
    )
}
export default reduxForm ({
    form: 'ForgotPassword',
    validate
  }) (forgotPasswordContainer);
